import React, { Component } from 'react';
import AdminLogin from '../auth/AdminLogin';
import AdminProfile from '../auth/AdminProfile';

class AdminView extends Component {
    constructor(props) {
        super(props);

        this.state = {
            user: this.props.user,
        }
    }

    render() {
        console.log(this.props);
        return (
            <div>
                {!this.props.user && <AdminLogin userChange={(e) => this.props.changeUser(e)} user={this.props.user} />}
                {this.props.user && <AdminProfile user={this.props.user} />}
                <button onClick={(e) => { this.props.test(e) }}> Test </button>

            </div>
        )
    }
}

export default AdminView;
